import React from 'react';
import './App.css';
import { Link } from 'react-router-dom';


function App() {
  return (
    <div className="App">
      <div class="home">
        <h1>Welcome to NYC Traffic Analyzer</h1>
        <p>Project by: Audrey Weigel, Ekin Atay, Andrea Moreno, and Shannon Harrison</p>
        <p>generate button might need to go to a log in screen for the oracle stuff to connect</p>
        <Link to="/generate"><button className="button" class="button" hoverable={true}>Generate Data</button></Link>
        <Link to="/custom"><button className="button" class="button">Custom Database Search</button></Link>
        <small>use this tool to filter any combination of variables to find the information you're looking for!</small>
      </div>
    </div>
  );
}

export default App;
